import React from 'react';
import TextField from '@mui/material/TextField';

const MyTextBox = () => {
  const customStyles = {
    '& .MuiOutlinedInput-root': {
      borderColor: 'white', // Change the outline color
    },
    '& .MuiInputLabel-outlined': {
      color: 'white', // Change the label color for better visibility if needed
    },
  };

  return (
    <TextField
      className='box'
      fullWidth
      label="Enter Text"
      id="fullWidth"
      variant="outlined"
      sx={customStyles} // Apply the custom styles directly
    />
  );
};

export default MyTextBox;
